import React from 'react';
import Stepper from "@material-ui/core/Stepper";
import { StepLabel } from '@material-ui/core';
const Register = () => {
  return (

    <Stepper>
         <Step>
                      <StepLabel>First</StepLabel>
         </Step>             
    </Stepper>
    
  )
};

export default Register;
